import React from "react";
import styled from "styled-components";

const StyleNav = styled.div`
  * {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
  }
  .navbarp {
    display: flex;
    justify-content: center;
    align-items: center;
    height: 60px;
    background: #3f3f3f;
    /* background-color: red; */
    color: black;
    font-family: "Raleway", sans-serif;
    box-shadow: 0 4px 6px rgb(0 0 0 / 30%);
    position: fixed;
    width: 100vw !important;
    top: 0;
    z-index: 1 !important;
    /* overflow: hidden; */
  }
  .navbarp h3 {
    display: flex;
    justify-content: flex-end !important;
    margin-left: 30%;
  }
  a {
    color: white !important;
  }
  .logo {
    font-size: 30px;
  }
  .nav-links {
    display: flex;
    justify-content: flex-end !important;
    list-style: none;
    width: 75px;
    margin-left: 90%;
  }
  li{
    text-decoration: none !important;  
  }
  .home,
  .about,
  .skills,
  .projects,
  .contact {
    text-decoration: none;
    color: white;
    font-size: 20px;
    padding: 10px 20px;
    margin: 0 10px;
    cursor: pointer;
  }
`;

export default function RespNavbar() {
  return (
    <>
      <div className="container-fluid" style={{ backgroundColor: "#3f3f3f", height:"60px", color:"white", textDecoration:"none" }}>
        <div className="row">
          <div className="col">
          <a href="#home" style={{color:"white"}}>
                  Home
                </a>
          </div>
          <div className="col">

          </div>
          <div className="col"  style={{display:"flex", textDecoration:"none", margin:"20px"}}>

              <div className="home">

              </div>
              <div className="about">

              </div>
              <div className="skills">
                <a href="#skills" style={{color:"white"}}>
                  Skills
                </a>
              </div>
              <div className="projects">
                <a href="#projects" style={{color:"white"}}>
                  Projects
                </a>
              </div>
              <div className="contact" style={{color:"white"}}>
                <a href="#footer">
                  Contact
                </a>
              </div>

          </div>
        </div>
      </div>
    </>
  );
}
